import React from 'react'

const IgrejaLogo = () => {
    return (
        <div className="gh-logo">
            <a href="https://instagram.com/metodistadabarra" target="_blank">
                <img src="../../imbt_logo_black.png"/>
            </a>
        </div>
    )
}

export default IgrejaLogo
